import './App.css';
import React,{useState} from 'react';
import Data from './data.json';
function App() {
    const [data, setdata] = useState([]);
    const apiGet = () => {
      var myInit = {
        method: 'GET',
        headers: {
          'Content-Type': 'application/json',
        },
        mode: 'cors',
        cache: 'default'
      };
      let myRequest = new Request('./data.json', myInit);
      fetch(myRequest)
      .then(response => response.json())
      .then((json) => {
        console.log(json);
        setdata(json);
      });
    };

    return (
        <div className="App">
          <h1>React Typescript</h1>
          <button onClick={apiGet}>Get Data</button>
          <br />
          <div>
          {JSON.stringify(data)}
          </div>   
        </div>
      );

}
export default App;
